import './App.css'
import { useState } from 'react';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import HomePage from './compo/HomePage';
import AddRoom from './compo/AddRoom';


function App() {

  const [rooms,addRooms]=useState([{name:'chen',color:'red'}])

  return (
    <div className="App">
       <BrowserRouter>
        <Routes>
          <Route path='/' element={<HomePage rooms={rooms} />} />
          <Route path='/addroom' element={<AddRoom  rooms={addRooms}/>} />
        </Routes>


      </BrowserRouter>



    </div>
  );
}

export default App;
